import React from 'react';
import produtos from '../../data/produtos';
import './TabelaProdutos.css'

export default (props) => {
  const listaprod = produtos.map((produto) =>{
    return(
    <li key={listaprod.id} >
      {produto.id} {produto.nome} {produto.preco}
    </li>
    )
  })


  return (
    <div>
      <table >
        <tr >
          <th>ID</th>
          <th>PRODUTO</th>
          <th>PREÇO</th>
        </tr>
        <tr>
          <td>{produto.id}</td>
          <td>2</td>
          <td>3</td>
        </tr>
      </table>
    </div>
  );
};
